const initialState = {
    sessions: []
  };

  const rootReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'SET_SESSIONS':
        return {
          ...state,
          sessions: action.payload
        };
      default:
        return state;
    }
  };

  export default rootReducer;
